  input: '"TEXT","F3XA","C00140590","Additionally, the committee is aware of the types
    of activity that must be reported on Line 30(b) as FEA.  The committee is also
    aware that certain public communications must be reported if a federal candidate
    is identified.  Since the committees controller and treasurer review each expenditure
    and its classification, please be advised that if there is an expenditure that
    is identified as FEA it is paid and reported accordingly in the correct manner.    The
    transfers shown reflect variations due to the timing of transfers based upon reimbursements
    from the non-federal and Levin accounts to the federal account at different points
    in the 70- day window provided in Reg. 106.7(f)(2).  No transfers were  made outside
    the seventy day window.    In regard to occupation and employer information requested,
    a letter is sent to those donors whose contributions exceed $200, but did not
    provide us with their employer and occupation on our initial contribution solicitation
    which sites the FEC regulation for the requested information.  The committees
    policy is to send a follow-up letter within thirty days of the original contribution
    to request this information with a pre-addressed envelope enclosed for the return
    of such information.  All such information received is reported accordingly.    This
    report includes a number of voided checks, which were issued in prior periods.      Sincerely,    Doug
    Boyd  California Republican Party"'
